import "./App.css";
import About from "./components/ComponentsIndex/About";
import Banner from "./components/ComponentsIndex/Banner";
import TopBar from "./components/ComponentsTopBar/TopBar";

function App() {
  return (
    <div className="App">
      <TopBar />
      <Banner />
      <About />
    </div>
  );
}

export default App;
